geregisseerd door Jee-woon Kim
met Arnold Schwarzenegger, Johnny Knoxville en Rodrigo Santoro

Voormalig LAPD-agent Owens (Arnold Schwarzenegger) heeft zich overgegeven aan het simpele leven in het kleine dorpje Sommerton Junction na een gefaalde operatie die zijn partner gehandicapt achterliet. Owens verdrijft zijn tijd daar door zich met kleine overtredingen bezig te houden als de aangewezen sheriff. Hij wordt uit zijn dagelijkse routine gehaald als er vlakbij een spectaculaire ontsnapping plaatsvindt, waarbij een drugsbaron samen met zijn bendeleden en een aantal gijzelaars in een gepantserde wagen ontsnappen. De drugsbaron besluit richting Mexico te reizen om aan de Amerikaanse autoriteiten te ontsnappen. Het enige dat hem nog in de weg staat om de grens te bereiken, is het dorpje Sommertown Junction, bewaakt door sheriff Owens.



